// src/HomePage.tsx

import React, { useContext } from "react";
import "./HomePage.css";
import { Link, Element, animateScroll as scroll } from "react-scroll";
import { ThemeContext } from "./themeContext";
import { scrollToBottom } from "react-scroll/modules/mixins/animate-scroll";

const HomePage: React.FC = () => {
  const { theme, toggleTheme } = useContext(ThemeContext);

  const scrollToTop = () => {
    scroll.scrollToTop();
  };

  return (
    <div className="home-page">
      <button
        className="interactive-button to-top-button"
        onClick={scrollToTop}
        style={{ backgroundColor: theme.button }}
      >
        ▲
      </button>
      <button
        className="interactive-button to-bottom-button"
        onClick={scrollToBottom}
        style={{ backgroundColor: theme.button }}
      >
        ▲
      </button>
      <div className="navbar">
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section1"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Home
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section2"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Resume
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section3"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Projects
          </Link>
        </button>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          <Link
            activeClass="active"
            to="section4"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Photography
          </Link>
        </button>
        <button
          onClick={toggleTheme}
          className="theme-toggle"
          style={{ backgroundColor: theme.toggle }}
        >
          Toggle Theme
        </button>
      </div>

      <Element
        name="section1"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Welcome to Home</h1>
        <button
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          Click Me
        </button>
      </Element>

      <Element
        name="section2"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Resume</h1>
        <p>Your inline resume goes here</p>
        <a
          href="link-to-your-resume.pdf"
          download
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          Download Resume
        </a>
      </Element>

      <Element
        name="section3"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Projects</h1>
        {Array(5)
          .fill(0)
          .map((_, index) => (
            <div key={index}>
              <h2>Project {index + 1}</h2>
              <p>Brief overview of the project goes here</p>
              <a
                href="link-to-project"
                className="interactive-button"
                style={{ backgroundColor: theme.button }}
              >
                Project Link
              </a>
            </div>
          ))}
      </Element>

      <Element
        name="section4"
        className="element"
        style={{ backgroundColor: theme.section }}
      >
        <h1>Photography</h1>
        <p>Your inline website view goes here</p>
        <a
          href="link-to-your-photography-website"
          className="interactive-button"
          style={{ backgroundColor: theme.button }}
        >
          Visit Photography Website
        </a>
      </Element>
    </div>
  );
};

export default HomePage;
